zipCode.push('11763');
for (let i = 0; i < zipCode.length; i++) {
  cy.visit('https://www.weightwatchers.com');
  cy.viewport(1580, 1620);
  cy.xpath('//*[text()="Find a Workshop"]', {
    timeout: 4000
  }).eq(0).click({
    force: true
  }); // cy.xpath('//*[text()="Virtual"]',{timeout:4000}).click({ force: true });
  cy.xpath('//*[@id="location-search"]', {
    timeout: 4000
  }).click({
    force: true
  }); // cy.xpath('//*[@id="location-search"]', { timeout: 4000 }).type(zipCode[i]);
  cy.xpath('//input[@id="location-search"]', {
    timeout: 4000
  }).type("11417");
  cy.xpath('//*[@id="location-search-cta"]', {
    timeout: 4000
  }).click({
    force: true
  });
  cy.xpath('//*[@id="location-1252589"]').eq(0).then($searchResult => {
    const textResult = $searchResult.text();
    cy.log(textResult);
    cy.addContext(textResult);
    cy.xpath('//*[@class="linkContainer-1NkqM"]', {
      timeout: 4000
    }).eq(0).click({
      force: true
    });
  }); //end of then
  cy.scrollTo(0, 200);
  cy.xpath('//*[@id="studioWorkshopSchedule"]').then($searchResult => {
    const textResult = $searchResult.text();
    cy.log(textResult);
    cy.addContext(textResult);
  }); //end of then
